const jsonScenarios = {
    "scenarios": [
        "would win in a fight to the death?",
        "would make a better senator for the Galactic Senate?",
        "would win in a lightsaber duel?",
        "would make a better nerf-herder?",
        "would make a better pilot?"
    ]
};

export default jsonScenarios;
